import React, { Component } from 'react';
import './Profile.css';

import state from "../../redux/state";
import {rerender} from "../../render";

const Profile = (props) => {
    return (
        <nav className='profile'>
            <center>
         <div className='item'><img src='https://sun9-26.userapi.com/impf/c846520/v846520497/143c47/BJnz-LBzzOo.jpg?size=200x0&quality=90&crop=1059,169,899,1269&sign=6c20964b305f6dc10933ab8e3fdacdda&ava=1'/></div>
         </center>
         <center><b><div>{state.ProfileInfo[0].name}</div></b></center>
        <div> <center>Frontend разработчик</center></div>
            <div> <center>{state.ProfileInfo[0].city}</center></div>
        <br></br>
        <div><center>Подписок:</center></div>
        <div><center><b>34</b></center></div>
        <br></br>
        <div><center>Подписчиков:</center></div>
        <div><center><b>155</b></center></div>
        <br></br>
        <center><div className='item'><b>Посмотреть профиль</b></div></center>
      </nav>
    )
}
rerender();
export default Profile;
